export const DAYS = ["Mon", "Tue", "Wed", "Thur", "Fri", "Sat", "Sun"];

export const MOCKAPPS = [
  { date: new Date(2024, 1, 3), title: "Read", color: "#238783" },
  { date: new Date(2024, 1, 6), title: "Read again", color: "#708898" },
  { date: new Date(2024, 1, 25), title: "Read more", color: "#047106" },
  { date: new Date(2024, 1, 3), title: "class4", color: "#371395" }
];
